import React from "react";
import "../style/home.css";

class HomePage extends React.Component {
  render() {
    return (
      <div className="center">
        <h2>Please enter your delivery information:</h2>
        <fieldset>
            </fieldset>>
        <button
          className="btn"
          onClick={() => {
            console.log("Button clicked!");
          }}
        >
          Submit
        </button>
      </div>
    );
  }
}

export default HomePage;
